tables.table_schema:
CREATE TABLE meet_schedule (
  meet_id INT PRIMARY KEY,
  meet_date DATE,
  meet_location VARCHAR(255)
);

CREATE TABLE meet_results (
  result_id INT PRIMARY KEY,
  meet_id INT,
  event_type VARCHAR(50),
  result_time TIME
);

CREATE TABLE SwimMeetSchedule (
    meet_id SERIAL PRIMARY KEY,
    meet_name TEXT NOT NULL,
    start_date DATE NOT NULL,
    end_date DATE NOT NULL
);

CREATE TABLE MeetResults (
    result_id SERIAL PRIMARY KEY,
    meet_id INTEGER REFERENCES SwimMeetSchedule(meet_id) ON DELETE CASCADE,
    swimmer_name TEXT NOT NULL,
    event_name TEXT NOT NULL,
    swim_time INTERVAL NOT NULL
);

CREATE TABLE Swimmers (
    swimmer_id SERIAL PRIMARY KEY,
    swimmer_name TEXT NOT NULL,
    age INTEGER,
    team_name TEXT
);

CREATE TABLE swim_meets (
  meet_id INT PRIMARY KEY,
  meet_name VARCHAR(50) NOT NULL,
  meet_date DATE
);

CREATE TABLE swim_events (
  event_id INT PRIMARY KEY,
  event_name VARCHAR(50) NOT NULL,
  distance INT,
  stroke_type VARCHAR(20)
);

CREATE TABLE swimmers (
  swimmer_id INT PRIMARY KEY,
  first_name VARCHAR(50) NOT NULL,
  last_name VARCHAR(50) NOT NULL,
  team_name VARCHAR(50)
);
